import React from 'react'

export default function Echarts(countries) {
  return (
    <div className='Echarts'>
      <div className='chart__statistical'>
        <div className='chart__infections'>
        {countries.map(({ Country, ISO2 }) => (
          <option key={ISO2} value={ISO2.toLowerCase()}>
            {Country}
          </option>
        ))}
        </div>
        <div className='chart__deaths'>
        </div>
      </div>
      <div className='chart__map'>

      </div>
      
    </div>
  )
}
